function writeStateFromAscii({state,gridSize,ascii,startRow,startCol}){var r=(ascii=ascii.replaceAll(/[\t ]/g,"")).split("\n").filter(row=>0!==row.length),i=startRow??Math.floor(gridSize/2)+Math.floor(r.length/2),e=startCol??Math.floor(gridSize/2)-Math.floor(r[0].length/2);for(let o=0;o<r.length;o++)for(let t=0;t<r[o].length;t++)"."!==r[o][t]&&(state[gridSize*(i-o)+(e+t)]=1)}export{writeStateFromAscii};